import React from 'react'
import Container from "react-bootstrap/Container";
import styled from "styled-components";
import Skewleft from './Skewleft';
import Typography from '@mui/material/Typography';

const Areacounting = () => {
    const Countingwrapper = styled.section`
        display:flex;
        position:relative;
        .counting_section{
            margin-top:270px;
            height:100vh;
            .parent{
                border: solid;
                display: flex;
                flex-direction: row;
                flex-wrap: wrap;
                section{
                    flex:1 1 50%;
                }
                .label{
                    h3{
                    color:${({theme})=>theme.colors.headeractive};
                    font-family:inherit;
                    margin:0!important;
                    }
                    span{
                        color:${({theme})=>theme.colors.text7};
                        padding: 0px 6px;
                        position: relative;
                        font-size:14px;
                    }
                }
            }
        }
    
    `;

  return (
    <Countingwrapper>
        <Skewleft/>
        <Container className="counting_section common_margin">
            <div className='parent'>
                <section className='label'>
                    <Typography variant="h3" className='mt-3'>Let's check</Typography>
                    <span>No. of student by Area</span>
                </section>
                <section className='list'>
                    <section className=''></section>
                </section>
            </div>
        </Container>
    </Countingwrapper>
  )
}

export default Areacounting
